// designed by alongio
import React, { useEffect, useState } from "react";

type Accent = "cyan" | "red" | "mgmt";

interface ThreePanelsProps {
  onNavigate: (page: string) => void;
}

export default function ThreePanels({ onNavigate }: ThreePanelsProps) {
  const [active, setActive] = useState<number>(1); // default: Meccanica
  const [isOn, setIsOn] = useState(false);

  useEffect(() => {
    const raf = requestAnimationFrame(() => setIsOn(true));
    return () => cancelAnimationFrame(raf);
  }, []);

  const onKey =
    (idx: number) =>
    (e: React.KeyboardEvent<HTMLElement>) => {
      if (e.key === "Enter") {
        setActive(idx);
      }
    };

  return (
    <section className="tpSection" aria-label="3 panels">
      {/* ambient SOLO dentro la sezione (non fixed) */}
      <div className="tpAmbient" aria-hidden="true" />

      <div className={`tpGrid ${isOn ? "tpOn" : ""}`}>
        {/* 1) ELETTRICA */}
        <section
          className={`tpPanel ${active === 0 ? "tpActive" : ""}`}
          style={{ ["--i" as any]: 0 }}
          data-accent={"cyan" satisfies Accent}
          tabIndex={0}
          aria-label="Elettrica"
          onMouseEnter={() => setActive(0)}
          onFocus={() => setActive(0)}
          onClick={() => setActive(0)}
          onKeyDown={onKey(0)}
        >
          <div className="tpIcon" aria-hidden="true">
            <svg viewBox="0 0 220 220" fill="none">
              <g
                stroke="rgba(232,238,247,.78)"
                strokeWidth="2.4"
                strokeLinejoin="round"
                strokeLinecap="round"
              >
                <path d="M122 22 L70 118 H118 L96 198 L150 104 H108 L122 22 Z" />
              </g>
              <g opacity=".55" stroke="rgba(232,238,247,.35)" strokeWidth="1.2">
                <path d="M156 42 C182 66 190 96 182 132" />
                <path d="M60 52 C34 78 28 108 38 146" />
              </g>
            </svg>
          </div>

          <div className="tpContent">
            <h2 className="tpTitle">Elettrica</h2>
            <p className="tpDesc">
              Architettura elettronica, cablaggi, sensori e integrazione. Dati affidabili, sistemi
              robusti.
            </p>
            <button 
              className="tpBtn" 
              type="button"
              onClick={(e) => {
                e.stopPropagation();
                onNavigate("electric");
              }}
            >
              Explore
            </button>
          </div>
        </section>

        {/* 2) MECCANICA */}
        <section
          className={`tpPanel ${active === 1 ? "tpActive" : ""}`}
          style={{ ["--i" as any]: 1 }}
          data-accent={"red" satisfies Accent}
          tabIndex={0}
          aria-label="Meccanica"
          onMouseEnter={() => setActive(1)}
          onFocus={() => setActive(1)}
          onClick={() => setActive(1)}
          onKeyDown={onKey(1)}
        >
          <div className="tpIcon" aria-hidden="true">
            {/* Wrench (leggero, no base64) */}
             <svg xmlns="http://www.w3.org/2000/svg" width="1024" height="1024" viewBox="0 0 1024 1024">
                <image x="0" y="0" width="1024" height="1024"
                  href="data:image/png;base64,"
                  preserveAspectRatio="none" />
              </svg>

          </div>

          <div className="tpContent">
            <h2 className="tpTitle">Meccanica</h2>
            <p className="tpDesc">
              Telaio, sospensioni, powertrain e manufacturing. Prestazioni misurabili, iterazione
              rapida.
            </p>
            <button
              className="tpBtn"
              type="button"
              onClick={(e) => {
                e.stopPropagation();
                onNavigate("mech");
              }}
            >
              Explore
            </button>
          </div>
        </section>

        {/* 3) MANAGEMENT */}
        <section
          className={`tpPanel ${active === 2 ? "tpActive" : ""}`}
          style={{ ["--i" as any]: 2 }}
          data-accent={"mgmt" satisfies Accent}
          tabIndex={0}
          aria-label="Management"
          onMouseEnter={() => setActive(2)}
          onFocus={() => setActive(2)}
          onClick={() => setActive(2)}
          onKeyDown={onKey(2)}
        >
          <div className="tpIcon" aria-hidden="true">
            <svg viewBox="0 0 220 220" fill="none">
              <circle cx="110" cy="110" r="70" stroke="rgba(232,238,247,.78)" strokeWidth="2" />
              <ellipse
                cx="110"
                cy="110"
                rx="70"
                ry="32"
                stroke="rgba(232,238,247,.56)"
                strokeWidth="2"
              />
              <ellipse
                cx="110"
                cy="110"
                rx="70"
                ry="50"
                stroke="rgba(232,238,247,.46)"
                strokeWidth="2"
              />
              <ellipse
                cx="110"
                cy="110"
                rx="70"
                ry="62"
                stroke="rgba(232,238,247,.36)"
                strokeWidth="2"
              />
              <g transform="rotate(90 110 110)">
                <ellipse
                  cx="110"
                  cy="110"
                  rx="70"
                  ry="32"
                  stroke="rgba(232,238,247,.56)"
                  strokeWidth="2"
                />
                <ellipse
                  cx="110"
                  cy="110"
                  rx="70"
                  ry="50"
                  stroke="rgba(232,238,247,.46)"
                  strokeWidth="2"
                />
                <ellipse
                  cx="110"
                  cy="110"
                  rx="70"
                  ry="62"
                  stroke="rgba(232,238,247,.36)"
                  strokeWidth="2"
                />
              </g>
            </svg>
          </div>

          <div className="tpContent">
            <h2 className="tpTitle">Management</h2>
            <p className="tpDesc">
              Pianificazione, risorse, sponsor e coordinamento. Un progetto coerente, dallidea al
              risultato.
            </p>
            <button
              className="tpBtn"
              type="button"
              onClick={(e) => {
                e.stopPropagation();
                onNavigate("management");
              }}
            >
              Explore
            </button>
          </div>
        </section>
      </div>
    </section>
  );
}